  const [data, setData] = useState<IBeer | []>([])

  useEffect(()=>{
    (
      async()=>{
        const getBeerData = await getBeer()
        setData(getBeerData)
      }
    )()
  },[])

  console.log("data",data)
  return (   
      <div>BeerList</div>
  )
}
